import { ADD_CONTATO } from "./contatos-actions";

import Contato from '../modelo/Contato'

const estadoInicial = {
    contatos: []
};

export default (estado = estadoInicial, action) => {

    switch (action.type) {
        case ADD_CONTATO:
            const l = new Contato(new Date().toString(), action.dadosContato.nomeContato, action.dadosContato.telefone);
            return {
                contatos: estado.contatos.concat(l)
            }
        default:
            return estado;
    }
}
